exports.command = function(cli, zz1,zz2,zz3,zz5,zz6,zz7,zz8,zz,a,b,c,city,address,doctor,email){
	this
	.useCss()
	.getAttribute('#clinicname' , 'value' , function(result){
  cli.push(result.value)                   
})

.getAttribute('#clinicphone' , 'value' , function(result){
    var aa=result.value[1]+result.value[2]+result.value[3]+result.value[6]+result.value[7]+result.value[8]+result.value[10]+result.value[11]+result.value[12]+result.value[13]
     zz1.push(aa)
})

.getAttribute('#zipcode' , 'value' , function(result){
    zz2.push(result.value)
})

.getAttribute('#doctorphone' , 'value' , function(result){
  var bb=result.value[0]+result.value[1]+result.value[3]+result.value[4]+result.value[5]+result.value[6]+result.value[7]+result.value[8]+result.value[9]
    zz3.push(bb)
})

.getAttribute('#city' , 'value' , function(result){ 
    zz5.push(result.value)
})

.getText('#address' , function(result){ 
    zz6.push(result.value)
})

.getAttribute('#physicianname' , 'value' , function(result){
    zz7.push(result.value)
})

.getAttribute('#emailId' , 'value' , function(result){
    zz8.push(result.value)
})
this

     .verify.valueContains('#clinicname' , zz)
     .verify.valueContains('#clinicphone' , '('+a.toString().substring(0, 3)+') '+a.toString().substring(3, 6)+'-'+a.toString().substring(6, 10))
     .verify.valueContains('#zipcode' , b)
     .verify.valueContains('#doctorphone' , c.toString().substring(0, 2)+'-'+c.toString().substring(2, 9))
     .verify.valueContains('#city' , city)
     .verify.containsText('#address' , address)
     .verify.valueContains('#physicianname' , doctor)
     .verify.valueContains('#emailId' , email)
return this
}